import axios from "axios";
import { useDispatch } from "react-redux";
import { FETCH_POST_REQUEST,
    FETCH_POST_SUCCESS,
    FETCH_POST_ERROR, } from "../actions/type"

export const loadPosts = (page) => async (dispatch) => {
  try {


    const res = await axios.get(
      `https://dev.api.codekitten.vn/api/v1/project/search?name=%20&page=${page}`
    );
    const responseBody = res.data.data.data;
    console.log(responseBody);
    const id = responseBody[0].created_by;
    console.log(id);
    dispatch({
      data: responseBody,
    });
  } catch (error) {
    console.error();
  }
};
